const stylee = ({ ID }) => {
  function styleee() {
    if (ID === 3) {
      return {
        borderRadius: "6px",
        background: "#74BDE0",
        color: "White",
        fontFamily: "Poppins",
        fontSize: "20px",
        fontWeight: "500",
      };
    }
  }

  return styleee;
};

export default stylee;
